import React, {Component} from 'react'
import {render} from 'react-dom'

let skiData = {
    goal: 100,
    total: 10
}

class Message extends Component {
    render() {
        const {total, goal} = this.props;
        return (
            <div>
                <span>Following is the data</span>
                <h4>Goal - {goal}</h4>
                <h4>Total - {total}</h4>
                <h4>Goal Progress - {total}</h4>
            </div>
        )
    }
}

render(
    <Message 
    goal={skiData.goal}
    total={skiData.total} />,
  document.getElementById('root')
)
